import React, { Component } from "react";
import Header from "./components/Header";
import Members from "./components/Members";
import Pwnable from "./components/Pwnable";
import Web from "./components/Web";
import Crypto from "./components/Crypto";
import Reverse from "./components/Reverse";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      navigator: <Members></Members>,
      members: [
        {
          name: "JSec",
          job: "Pwn",
          image: "/profiles/JSec.png",
          facebook: "",
          twitter: "",
          blog: "",
          message: "",
        },
      ],
    };

    this.navigate = (Path) => {
      switch (Path) {
        case "Pwnable":
          this.setState({
            navigator: <Pwnable></Pwnable>,
          });
          break;

        case "Web":
          this.setState({
            navigator: <Web></Web>,
          });
          break;

        case "Crypto":
          this.setState({
            navigator: <Crypto></Crypto>,
          });
          break;

        case "Reverse":
          this.setState({
            navigator: <Reverse></Reverse>,
          });
          break;

        default:
          this.setState({
            navigator: <Members></Members>,
          });
      }
    };
  }

  render() {
    return (
      <div className="App">
        <Header></Header>
        {this.state.navigator}
      </div>
    );
  }
}

export default App;
